import {Component, OnInit, ViewChild} from '@angular/core';
import {Title} from '@angular/platform-browser';
import {Router, NavigationEnd} from '@angular/router';
import {MainContainerComponent} from 'projects/projbase/src/public-api';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
})
export class AppComponent implements OnInit {

  constructor(
    private _router: Router,
    private _titleService: Title) {
  }

  loggedUser = {
    initial: 'E',
    firstName: 'Elon',
    lastName: 'Musk',
    email: 'elonmusk@orgltd.com',
    uri: 'components/notifications',
    avatarImage: 'data:image/jpeg;base64,'
  };

  public navbarShrink = false;
  @ViewChild('sidebar', {static: false}) sidebarRef!: MainContainerComponent;

  public isLogged = false;

  ngOnInit(): void {
    this._router.events.subscribe((evt) => {
      if (!(evt instanceof NavigationEnd)) {
        return;
      }

      window.scrollTo(0, 0);
    });

    this._titleService.setTitle('Identidade Visual - Angular Material');
  }

  public scrollPage(evt: number): void {
    if (!this.navbarShrink && evt > 80) {
      this.navbarShrink = true;
    }

    if (this.navbarShrink && evt < 50) {
      this.navbarShrink = false;
    }
  }

  openMenu(): void {
    if (this.sidebarRef) {
      this.sidebarRef.openMenu();
    }
  }

  login(): void {
    this.isLogged = !this.isLogged;
  }

  logoff(): void {
    this.isLogged = !this.isLogged;
  }
}
